description:
Verenigde Staten
Komedie / Romantiek
90 minuten

goed

met Mandy Moore, John Krasinski en Robin Williams

Ben Murphy en Sadie Jones zijn een gelukkig stel dat besluit te gaan trouwen. Dit willen ze doen in de plaatselijke kerk. Maar 
om te laten zien dat ze altijd bij elkaar zullen blijven moeten ze van de priester een aantal huwelijkstests ondergaan. Als ze 
slagen zal hij het huwelijk voltrekken.
